    data: |
      SELECT DISTINCT - cor1.col0 * + 54 FROM tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q9685.out
    data: |
      -1296
      -1890
      -4806
